import { useState } from "react"


export const Usuario = ({nombre, largo}) =>{
    const [usuario,setUsuario] = useState("");
    const [clave,setClave] = useState("");
    
    function actualizarUsuario(e){
        setUsuario(e.target.value);
    }
    function actualizarClave(e){
        setClave(e.target.value);
    }


    return <div>
        <h1>Inicio de sesion</h1>
        <form>
            <div>Usuario:<input typer="text" value={usuario} onChange={actualizarUsuario}/></div>
            <div>Clave:<input typer="text" value={clave} onChange={actualizarClave}/></div>
        </form>
        <button>Holis </button>
        <hr/>


    </div>
}
